// App.js
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Hero from './components/Hero.js';
import Services from './components/Services.js';
import Blog from './components/Blog.js';
import RegisterPage from './components/Register.js'; // Ensure this is correctly imported
import Dashboard from './components/Dashboard.js';
import ProfilePage from './components/Profile.js';
import Features from './components/Features'; 
import Contact from './components/contact.js';
import Pricing from './components/Pricing.js';
import SolubilityChecker from './components/SolubilityChecker.js';
import Chatbot from './components/Chatbot.js';
import VirtualScreening from './components/VirtualScreening.js';
import CYP3A4Predictor from './components/CYP3A4.js';
//import BBBP from './components/BBBP.js';
//import LandingPage from './components/LandingPage.js';
//import DrugForgeSMILESPredictor from './components/DrugForgeSMILESPredictor.js'; //Its working (frontend)
const App = () => (
  <div>
    <Header />
    <CYP3A4Predictor />
    <VirtualScreening />



    <main>
      <Routes>
        <Route path="/" element={<Hero />} />
        <Route path="/features" element={<Features />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/register" element={<RegisterPage />} /> 
        <Route path="/profile" element={<ProfilePage />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/contact" element={<Contact />} /> 
        <Route path="/pricing" element={<Pricing />} />

      </Routes>
    </main>
    <SolubilityChecker />
    <Services />
    <Features />
    <Blog />
    <Contact />
    <Pricing />
    <Footer />
    <Chatbot />
  </div>
);

export default App;
